      "approved": true,
      "available": true,
      "comments": "Currently, there is no acting legislature in Palestine. Therefore, the president has the authority to enact (approve) the annual budget. The president enacted the budget on Feb. 10, 2014, and it was subsequently published within two months, on April 6, 2014. Therefore, the document is considered publicly available. Keep in mind that although the document is considered publicly available according to the OBS standards, its publication is late according to Palestinian law, which mandates the budget be approved before the start of the Fiscal Year. ",
