      "id": "53ea7842701f63020000002d",
      "approved": true,
      "available": true,
      "comments": "As it could be seen from the “When and Where” chart, according to Armenian legislation, EBP consists of three documents: a) Budget Address of the Government, b) Draft Law on the State Budget, and, c) Official Conclusion of the Central Bank of the Republic of Armenia on the Budget Statement. The researcher did not find any web link for the Official Conclusion of the Central Bank of the Republic of Armenia on the Budget Statement. It could be considered that the Official Conclusion of the Central Bank of the Republic of Armenia on the Budget Statement is not publicly available considering the time-frames of OBS Tracker. However, later the Researcher received that document (in Armenian) and it is now uploaded. After the State Budget (EB) for FY 2014 was adopted, the Draft Law on the State Budget was removed from the mentioned web-sites.   ",
