      "approved": true,
      "available": true,
      "comments": "Documents are uploaded to the Bureau of the Treasury website by established practice. The Treasury does not release separate monthly reports. The same file is updated monthly and is uploaded on the same web link. The Report on Utilization of Cash Allocation is available in PDF and spreadsheet formats.\r\n\r\nThe reports released by the Bureau of the Treasury are publicly available. The Disbursement Performance Reports from the Department of Budget and Management, meanwhile, are not publicly available.\r\nComments: The researcher wrote a letter to the Department of Budget and Management on March 24, 2014 requesting a copy of the December 2013 report. The next day, March 25, a DBM staff replied and said that the Fiscal Planning Bureau is “currently completing the end-December 2013 reports.” He said they would inform the researcher “as soon as these are already available online.” DBM’s December 2013 reports were not made available online by March 31, 2014 or when the researcher stopped searching for the document.\r\n",
