      "id": "54aa2abf39b7730200000002",
      "approved": true,
      "available": true,
      "comments": "The researcher’s first request for a copy of the YER was sent on May 21, 2014. The DBM replied and said it would be most likely published between late second quarter and fourth quarter of 2014. Then the researcher sent a second letter of request on August 22, 2014. One of the DBM staff replied and wrote in an email, “The preparation of the 2013 Year-End and 2014 Mid-Year Reports (are) still in process as we are trying to adopt the new Open Budget Survey methodology in our reports, as well as to follow most of the best practices recommended by other institutions. I believe that the OB survey allows us until end of September to publish the MYR, which we intend to meet.” The researcher sent a follow-up letter regarding the request for a copy of the Year-end report on September 30. On the same day, the DBM staff emailed and said that it is still being completed. The researcher was not able to locate the document on December 31, 2014, January 1 and 5, 2015. On January 20, 2015, however, one of the DBM staff confirmed that YER's date of publication is December 29, 2014. He said that \"it was incidentally posted under the NG Disbursement Performance for 2013, still under the DBCC tab.\"  He said that the web administrator was advised to transfer the YER 2013 to the Year-end Report page under DBCC tab. He provided the researcher with a copy of the email thread/exchange requesting for the transfer of the YER report. The email thread indicates that the request, and subsequently the transfer, was made on January 5. The researcher was able to retrieve the document on January 17, 2015.",
