      "comments": "Article 44 of Budget and Public Financial Management Law on Quarterly Reports on Budget Execution: \r\n1 - The Government shall submit to the National Parliament and the Chamber of Auditors of the Administrative, Fiscal, Auditors High Court reports on the progress of the budget concerning the first three, six and nine months of each financial year.\r\n2 – The time limit for delivering the reports indicated in the previous paragraph is two months after the end of the period covered by the reports.\r\n3 – The reports on the evolution of the budget shall include a report on revenues and expenses, containing the information described in article 4, along with information on assets and liabilities containing the information described in article 45.5.",
