      "comments": "The In- year-report- 2nd quarter is not ready yet. However, the Government of Ghana under the leadership of the Ministry of Finance and Economic Planning has completed and presented to parliament a ‘Mid year review report’commonly called supplementary estimates/budget on Tuesday, July 21, 2015. The report is also published on the Ministry’s website both highlights and speech. The report is provided in accordance with article 179 (8) of the 1992 Constitution. The Mid year review report updated parliament and citizens on the performance of the economy in 2014 and for the first five months of 2015 and request for approval for supplementary estimates for 2015. The 2015 Supplementary Estimates amounted to a total of GH¢865,789,380.00, with a public budget deficit which now stands at GH¢90.0 billion",
