      "available": true,
      "internal": false,
      "year": "2016",
      "comments": "2)\tLe Projet de Loi Portant Budget de l’Etat pour l’année 2016 : Nous avons constaté le 20 Octobre 2015 qu’un document intitulé « Projet de Loi de Finances portant Budget de l’Etat pour l’année 2016 » a été mis sur le site (ci-joint). Les grandes lignes du budget ont été mentionnées dans le document, toutefois les détails n’ont pas été donnés dans celui-ci. Ainsi, compte tenu du fait que nous avons pu obtenir le Projet de Loi de Finances portant Budget de l’Etat pour l’année 2015 en document physique lors de la recherche l’année passée, nous sommes entrés en contact avec les autorités afin de voir dans quelle mesure pouvoir disposer de celui de 2016 en document physique. Elles nous ont donné l’assurance de faire en sorte que le document soit mis à notre disposition dès que possible. ",
